import React, { Component } from 'react';

class ListOfProjs extends Component {
	
	constructor(props) {
		super(props);
		
		this.createProj = this.createProj.bind(this);
	}
	
	createProj(proj) {
		return <li key={proj.proj_name}>{proj.proj_task}</li>
	}
	
	render() {
		let list = this.props.projs.map((proj) => {return(this.createProj(proj))});
		
		return(
			<ul>
				{list}
			</ul>
		);
	}
}

export default ListOfProjs;
